import styles from "../assets/NavBarMenu.module.css";
import { Link } from "react-router-dom";

function NavBarMenu() {
  return (
    <li className={styles.navBarContainer} id="navBarContainer">
      <Link to="/">
        <p>Home</p>
      </Link>
      <Link to="/shows">
        <p>Shows</p>
      </Link>
      <Link to="/contact">
        <p>Contact</p>
      </Link>
      <Link to="/about">
        <p>About</p>
      </Link>
      <a href="javascript:void(0);" className={styles.icon} onclick="showFunction()">
        <i class="fa fa-bars"></i>
      </a>
    </li>
  );
}

function showFunction() {
  var x = document.getElementById("navBarContainer");
  if (x.className === "navBarContainer") {
    x.className += " responsive";
  } else {
    x.className = "navBarContainer";
  }
}

export default NavBarMenu;
